CREATE OR REPLACE FUNCTION manutencao() RETURNS VOID AS $$
DECLARE
    stSQL       VARCHAR;
    reRecord    RECORD;
    inCodConta  INTEGER;
    stExercicio VARCHAR;
BEGIN

    PERFORM 1
       FROM pg_class
       JOIN pg_attribute
         ON pg_attribute.attrelid = pg_class.oid
       JOIN pg_namespace
         ON pg_class.relnamespace = pg_namespace.oid
      WHERE pg_namespace.nspname = 'contabilidade'
        AND pg_class.relname = 'plano_conta'
        AND pg_attribute.attname = 'obrigatorio_tcmgo'
        AND pg_attribute.attnum > 0
          ;
    IF NOT FOUND THEN
        ALTER TABLE contabilidade.plano_conta ADD COLUMN obrigatorio_tcmgo BOOLEAN NOT NULL DEFAULT FALSE;

        DELETE FROM tcmgo.vinculo_plano_contas_tcmgo WHERE exercicio = '2015';
        DELETE FROM tcmgo.plano_contas_tcmgo WHERE exercicio = '2015';
        ALTER TABLE tcmgo.plano_contas_tcmgo ALTER COLUMN titulo TYPE VARCHAR(150);


        stSQL := '
                   SELECT *
                     FROM tcmgo.plano_contas_tcmgo
                    WHERE exercicio = ''2015''
                        ;
                 ';
        FOR reRecord IN EXECUTE stSQL LOOP
        RAISE NOTICE 'estrutural: %', reRecord.estrutural;
            PERFORM 1
               FROM contabilidade.plano_conta
              WHERE cod_estrutural = reRecord.estrutural || '.00.00.00'
                AND exercicio      = reRecord.exercicio
                  ;
            IF FOUND THEN
                SELECT cod_conta
                     , exercicio
                  INTO inCodConta
                     , stExercicio
                  FROM contabilidade.plano_conta
                 WHERE cod_estrutural = reRecord.estrutural || '.00.00.00'
                   AND exercicio      = reRecord.exercicio
                     ;
                INSERT
                  INTO tcmgo.vinculo_plano_contas_tcmgo
                     ( exercicio       -- character(4) | not null
                     , cod_plano_tcmgo -- integer      | not null
                     , exercicio_tcmgo -- character(4) | not null
                     , cod_conta       -- integer      | not null
                     )
                VALUES
                     ( stExercicio
                     , reRecord.cod_plano
                     , reRecord.exercicio
                     , inCodConta
                     );
            END IF;
        END LOOP;
    END IF;
END;
$$ LANGUAGE 'plpgsql';

SELECT        manutencao();
DROP FUNCTION manutencao();

